pragma solidity ^0.8.7;

import "@openzeppelin/contracts/token/ERC721/ERC721.sol";
import "../Misc/iii6Logs.sol";
import "../Misc/Errors/iii6Errors.sol";
import "../Math/iii6DiaIdGen.sol";
import "./iii6DiaGreenListModel.sol";

contract iii6DiaModel is ERC721, iii6Logs, iii6Errors {
    address public owner;
    uint256 public minted;
    uint256 public max;
    string public nam;
    string public sym;
    bool public start; // ALLOWS MINT TO START
    uint256 public price;
    // token id # => dias obj %
    mapping(uint256 => bytes) public dias;
    // user address @ => nft count #
    mapping(address => uint256) public nftCount;
    // user address @ => nft count # => nft id #
    mapping(address => mapping(uint256 => uint256)) public ntfIdByCount;

    // error InvalidAmount();
    // error InsufficientBalance();
    iii6DiaGreenListModel iii6GL;

    modifier onlyO() {
        if (owner != msg.sender) revert Unauthorized();
        _;
    }

    /**
     * @dev this constructor creates a Dia NFT Token Contract
     * @param _owner contract admin
     * @param _name dia token name
     * @param _sym dia symbol
     * @param _max amount of tokens 0 = infinte
     * @param _price amount of gascoin for token
     * @param _g number of greenlist slots for Dia NFT project 0 = no greenlist
     */
    constructor(
        address _owner,
        string memory _name,
        string memory _sym,
        uint256 _max,
        uint256 _price,
        uint256 _g // 0 = no greenlist
    ) ERC721(_name, _sym) iii6Logs() {
        owner = _owner;
        nam = _name;
        sym = _sym;
        max = _max;
        price = _price * 10**15; // 1 ETH value == 1000 Input
        if (_g > 0) iii6GL = new iii6DiaGreenListModel(_g, address(this));
    }

    function changeMintState() external returns (bool) {
        return _cMS();
    }

    function _cMS() internal returns (bool) {
        return start = !start;
    }

    function isOwner(address _adr) external view returns (bool) {
        return _adr == owner ? true : false;
    }

    function mint(uint256 _amnt) external payable returns (uint256) {
        if (minted >= max || minted + _amnt >= max) revert Invalid_Amount();
        if (msg.value >= price * _amnt) revert Insufficient_Balance();
        _doMint(_amnt);
        return minted;
    }

    function grabIds(uint256 count) external view returns (uint256 ids) {
        return ids = ntfIdByCount[msg.sender][count];
    }

    function _doMint(uint256 _amnt) internal returns (uint256) {
        unchecked {
            if (_amnt > 7) revert();
            for (uint256 i; i < _amnt; ++i) {
                _mint(msg.sender, minted);
                ++minted;
            }
        }
        return minted;
    }

    function holder(uint256 _id) external view returns (address) {
        return ownerOf(_id);
    }
}

